import React from "react";
import Viagem from "./Viagem";

class Vector{
    constructor() {
        this.viagens = [
            new Viagem("São Paulo", "Rio de Janeiro", "6 horas", "02-06-2023"),
            new Viagem("Brasília", "Salvador", "2 horas", "05-06-2023"),
            new Viagem("Manaus", "Recife", "4 horas", "08-06-2023"),
            new Viagem("Curitiba", "Fortaleza", "3 horas", "10-06-2023"),
            new Viagem("Porto Alegre", "Natal", "4 horas", "15-06-2023"),
            new Viagem("Florianópolis", "Belém", "5 horas", "20-06-2023"),
            new Viagem("Goiânia", "Maceió", "3 horas", "25-06-2023")
        ];

    }

    addViagem(origem, destino, duracao, deadline) {
        let viagem = new Viagem(origem, destino, duracao, deadline);
        this.viagens.push(viagem);
    }

    sortViagensByDeadline() {
        this.viagens.sort((a, b) => a.deadline - b.deadline);
    }

    scheduleToMinimizeLateness() {
        this.sortViagensByDeadline();
        let time = 0;
        for (let viagem of this.viagens) {
            viagem.startTime = time;
            viagem.endTime = time + viagem.duracao;
            viagem.lateness = Math.max(0, viagem.endTime - viagem.deadline);
            time = viagem.endTime;
        }
    }
}

export default Vector;
